import React from 'react';
import {Text, TextInput, View} from 'react-native';

const Cat = () => {
    return (
    <View>
        <Text>Hello, I am your cat!</Text>
        <TextInput 
            style = {{
                height: 40,
                borderColor: 'gray',
                borderWidth: 1
            }}
            defaultValue='Name me!'
        />
    </View>)
}

export default Cat;
